let results = [];
const parser = new DOMParser();
const html = parser.parseFromString($._, "text/html");

const map = html.querySelector('img[src^="https://maptiles.finncdn.no/staticmap"]');
if (map) {
    results.push([map.src, "Map"]);
}

const imgs = html.querySelectorAll('div[data-carousel-container]>a');
if (imgs.length){
    for (const img of imgs) {
        const srcset = img.firstElementChild.srcset || img.firstElementChild.dataset.srcset;
        const src = srcset.split(',')[0].split(' ')[0];
        results.push([src, img.innerText]);
    }
}

return results;
